import { Container } from 'semantic-ui-react'
import JobPostingList from '../Pages/JobPostingList'

export default function Dashboard() {
    return (
        <div>
            <Container className='mycontainer'>
            </Container>
            <JobPostingList />
        </div>
    )
}
